import React, { Component } from 'react';
// import logo from './logo.svg';
import './App.css';
import facebookIcon from './icons/facebook.png';
import githubIcon from './icons/github.png';
import linkedinIcon from './icons/linkedin.png';
import wordpressIcon from './icons/wordpress.png';

class App extends Component {
  render() {
    return (
      <div>
        <header className="header">
          <h1>Trey Tamaki</h1>
          <h2></h2>
        </header>
        <br></br>
        <div className="body">
          <h3>Hello!</h3>
          <p>My name is Trey Tamaki! I am a fourth-year student at the University of Washington, Seattle Campus.</p>
          <p>I am getting my B.S. in Computer Science with a minor in Art History.</p>
        </div>
        <footer>
          <img src={facebookIcon}></img>
        </footer>
      </div>
    );
  }
}

export default App;
